import React from "react";
import doctors from "../img/doctor-undraw.svg";


export default function Quote() {
  return (
    <div class="w-full grid grid-cols-2 w-full text-left border bg-blue-700 py-5 px-5 md:py-36 md:px-36">
    <div>
      <h2 class="mb-2 text-1xl md:text-4xl font-bold text-white">
        “We are healthcare professionals with over 45 years of health care
        experience. Together we want to use genetics, life-style optimization,
        and disease prevention to help YOU live a fuller and happier life.”
      </h2>
      </div>
      <div>
      <img src={doctors} className="w-4/5 mx-auto" />
      </div>
    </div>
  );
}
